int check(char str[]){
  int i,j,k,l,flg=0;
  l=strlen(str);
  for(i=0;i<l;i++){
    if(strncmp(str+i,"iwi",3)==0 && flg==0){
      i+=2;
      flg=1;
      continue;
    }else if(str[i]=='i' || str[i]=='w') return 0;
  }
  if(flg==0) return 0;
  for(i=0;i<l;i++){
    if(str[i]=='(' && str[l-1-i]!=')') return 0;
    if(str[i]==')' && str[l-1-i]!='(') return 0;
    if(str[i]=='{' && str[l-1-i]!='}') return 0;
    if(str[i]=='}' && str[l-1-i]!='{') return 0;
    if(str[i]=='[' && str[l-1-i]!=']') return 0;
    if(str[i]==']' && str[l-1-i]!='[') return 0;
  }
  return 1;
}
